import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (hamburger menu)
    // Try to find the mobile nav menu button by class and text
    const navMenuSelector = '.nav-menu';
    await page.waitForSelector(navMenuSelector, { timeout: 5000 });

    // Click the mobile menu trigger
    await page.click(navMenuSelector);

    // Wait for the mobile menu overlay to appear
    const mobileMenuOverlaySelector = '#mobileMenuOverlay';
    await page.waitForSelector(mobileMenuOverlaySelector, { timeout: 5000 });

    // Add a small delay to allow menu animation (if any)
    await page.waitForTimeout(300);

    // Take screenshot of the open mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Try to find a category link inside the mobile menu (e.g., "Electronics")
    // Use xpath to find the first visible "Electronics" link inside the overlay
    const electronicsLinkXPath = "//div[contains(@class, 'mobile-menu-overlay') and contains(@class, 'show')]//a[contains(., 'Electronics')]";
    await page.waitForSelector(mobileMenuOverlaySelector + '.show', { timeout: 5000 });
    const [electronicsLink] = await page.$x(electronicsLinkXPath);

    let navigationSuccess = false;
    let clickedCategory = null;

    if (electronicsLink) {
      await electronicsLink.click();
      clickedCategory = 'Electronics';
      navigationSuccess = true;
    }

    // Take screenshot after clicking the category (should close menu and update content)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_clicked.png'));

    // Wait for the mobile menu overlay to disappear (menu closes)
    await page.waitForSelector(mobileMenuOverlaySelector + '.show', { state: 'detached', timeout: 5000 });

    // Verify that the main content now shows the Electronics category
    // Look for a heading or card with "Electronics"
    let categoryHeadingFound = false;
    let categoryCardFound = false;

    // Try to find a heading with "Electronics"
    const headingSelector = 'h2';
    const headings = await page.$$(headingSelector);
    for (const h of headings) {
      const text = (await h.textContent()) || '';
      if (text.toLowerCase().includes('electronics')) {
        categoryHeadingFound = true;
        break;
      }
    }

    // Try to find a category card with "Electronics"
    const cardSelector = '.category-card';
    const cards = await page.$$(cardSelector);
    for (const c of cards) {
      const text = (await c.textContent()) || '';
      if (text.toLowerCase().includes('electronics')) {
        categoryCardFound = true;
        break;
      }
    }

    // Take screenshot of the navigated category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_category_page.png'));

    // Now, open the mobile menu again to test closing via the close button
    await page.click(navMenuSelector);
    await page.waitForSelector(mobileMenuOverlaySelector + '.show', { timeout: 5000 });

    // Wait for close button inside the overlay
    const closeBtnSelector = '#mobileMenuOverlay.show .close-mobile-menu, .mobile-menu-overlay.show .close-mobile-menu';
    await page.waitForSelector(closeBtnSelector, { timeout: 5000 });

    // Take screenshot before closing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_before_close_menu.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_before_close_menu.png'));

    // Click the close button
    await page.click(closeBtnSelector);

    // Wait for overlay to disappear
    await page.waitForSelector(mobileMenuOverlaySelector + '.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_menu_closed.png'));

    return {
      success: navigationSuccess && (categoryHeadingFound || categoryCardFound),
      action: "Tested mobile menu navigation: opened menu, navigated to Electronics, verified content, and closed menu.",
      extractedData: {
        menuOpened: true,
        categoryClicked: clickedCategory,
        categoryHeadingFound,
        categoryCardFound,
        menuClosed: true
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
